@HerRoyalKahnum I disagree with your assessment.

WWF used its female talent to fulfil a very specific role in the Attitude Era. It wouldn't have mattered if the women in 2000 could put on 5* matches, WWF held the women down.

Chyna didn't interact with the women's division until 2001.

@HerRoyalKahnum Should Chyna have put more women over? Maybe.

Is it her fault that she wanted to protect her spot on the roster while other women were playing second fiddle to Mae Young and Stephanie McMahon? Not really.

WWF failed their women performers miserably and Chyna made the best of it

@HerRoyalKahnum Chyna got over at a time when the women's division was a joke.

Yeah she had backstage clout but she also was the only woman that was treated seriously on WWE TV. 

While Trish was barking like a dog and Lita was taking her shirt off before moonaaults, Chyna was breaking barriers
